import "./Notes.css";
import Note from "./Note";

const Notes = (props) => {
  const { notes } = props;


  return (
    <div className="notes">
      {notes.map((notes) => (
        <Note id={notes.id} title={notes.title} text={notes.text} />
      ))}
    </div>
  );
}

export default Notes;
